  "LongDescription": "Today you're going climbing in the Alps with your glider. A strong wind is blowing from the northwest. So be careful, because you will encounter strong turbulence on the summits. Your flight begins and ends at the Königsdorf gliding center. At take-off, you must not exceed a maximum altitude of 5000 feet. ($*$)You then fly to waypoint 1, to which you must climb to an altitude of at least 10,000 feet on the flank of the Zugspitze. ($*$)From there you fly down to waypoint 2 above the village of Imst. There you must not exceed a maximum altitude of 5000 feet. Then it goes directly into the mountains: on the flank of the Maningkogel you climb up to waypoint 3. ($*$)($*$)From there it goes over several ridges directly to waypoint 4. ($*$)It is advisable to follow the indicated path as directly as possible. Looking for a detour takes more time and effort than following the direct route. ($*$)Caution: there is a lot of turbulence up here. ($*$)($*$)Cross another ridge and you are already at waypoint 5. Then descend the valley to waypoint 6 above Innsbruck. ($*$)($*$)There you must not exceed a maximum altitude of 6000 feet. ($*$)From Innsbruck you then fly to waypoint 7 and from there out of the Alps directly to your final destination.",
